import React from "react";
import {
  SafeAreaView,
  View,
  Text,
  TouchableOpacity,
  Image,
  Dimensions,
} from "react-native";
import MaterialIcons from "react-native-vector-icons/MaterialIcons";
import MaterialCommunityIcons from "react-native-vector-icons/MaterialCommunityIcons";
import FontAwesome from "react-native-vector-icons/FontAwesome";
import AntDesign from "react-native-vector-icons/AntDesign";
import WebView from "react-native-webview";
import { StyleSheet } from "react-native";

const PhonePage = ({ route, navigation }) => {
  const { width, height } = Dimensions.get("window");
  return (
    <View>
      <View style={{ width: width, height: height }}>
        <Image
          style={styles.backgroundImage}
          source={require("../../assets/images/phone.png")}
        />
        <TouchableOpacity
          style={styles.mail}
          onPress={() => navigation.navigate("Mail Page")}
        >
          <Image
            style={styles.mail}
            source={require("../../assets/images/mailWithOneUnread.png")}
          />
        </TouchableOpacity>
        <Text
          onPress={() => navigation.navigate("Mail Page")}
          style={styles.mailWord}
        >
          Mail
        </Text>
      </View>
      <TouchableOpacity
        style={styles.market}
        onPress={() => navigation.navigate("Mail Page")}
      >
        <Image
          style={styles.mail}
          source={require("../../assets/images/coinWallet.png")}
        />
      </TouchableOpacity>
      <Text
        onPress={() => navigation.navigate("Mail Page")}
        style={styles.walletWord}
      >
        Wallet
      </Text>
    </View>
  );
};

const styles = StyleSheet.create({
  backgroundImage: {
    flex: 1,
    width: null,
    height: null,
    resizeMode: "stretch",
  },
  mail: {
    width: 50,
    height: 50,
    position: "absolute",
    bottom: "30%",
    left: "10%",
    resizeMode: "stretch",
  },
  mailWord: {
    width: 50,
    height: 50,
    position: "absolute",
    bottom: "27%",
    left: "28%",
    resizeMode: "stretch",
    color: "white",
  },
  walletWord: {
    width: 50,
    height: 50,
    position: "absolute",
    bottom: "27%",
    left: "12%",
    resizeMode: "stretch",
    color: "white",
  },
  market: {
    width: 50,
    height: 50,
    position: "absolute",
    bottom: "30%",
    left: "25%",
    resizeMode: "stretch",
  },
  container: {
    flex: 1,
  },
});
export default PhonePage;
